class DummyHyperdriveContractErrors:
    """ContractErrors for the DummyHyperdrive contract."""

    LnInvalidInput: DummyHyperdriveLnInvalidInputContractError

    ReentrancyGuardReentrantCall: (
        DummyHyperdriveReentrancyGuardReentrantCallContractError
    )

    UnexpectedSuccess: DummyHyperdriveUnexpectedSuccessContractError

    UnsafeCastToInt256: DummyHyperdriveUnsafeCastToInt256ContractError

    def __init__(
        self,
    ) -> None:
        self.LnInvalidInput = DummyHyperdriveLnInvalidInputContractError()
        self.ReentrancyGuardReentrantCall = (
            DummyHyperdriveReentrancyGuardReentrantCallContractError()
        )
        self.UnexpectedSuccess = DummyHyperdriveUnexpectedSuccessContractError()
        self.UnsafeCastToInt256 = (
            DummyHyperdriveUnsafeCastToInt256ContractError()
        )

        self._all = [
            self.LnInvalidInput,
            self.ReentrancyGuardReentrantCall,
            self.UnexpectedSuccess,
            self.UnsafeCastToInt256,
        ]

    def decode_custom_error(self, data: str) -> tuple[Any, ...]:
        """Decodes a custom contract error."""
        selector = data[:10]
        for err in self._all:
            if err.selector == selector:
                return err.decode_error_data(HexBytes(data[10:]))

        raise ValueError(
            f"DummyHyperdrive does not have a selector matching {selector}"
        )


